import React from 'react';
import Card from '../UI/Card';
import Button from '../UI/Button';


const ItemTramo = (props) => {
    return (
        <Card>
         <h1>8:00 A.M</h1>
         <Button> 8 Motos Disponibles</Button>

        </Card>
    );
};

export default ItemTramo;
